import React from "react";

function Aboutus() {
    return (
    <div className ="container aboutus">
        <div class = "row">
            <div class = "col left-side">
                lol
            </div>
            <div class = "col">
                <div class = "right-side">
                    <img id = "womancook" src="./images/auntytest.svg" alt="Woman Cooking"/>
                </div>
            </div>
        </div>
    </div>
    );
}

export default Aboutus;
